script: |
  super -f text -I q11454.spq | sort > q11454.out

inputs:
  - name: q11454.spq
    data: |
      SELECT ALL - - ( - col0 ) AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT CAST ( NULL AS INTEGER ) BETWEEN 93 AND 49 + + + 70 + col1 / + - 10 * - + col2;
  - name: tab2

outputs:
  - name: q11454.out
    data: |
